import React, { Component } from 'react';

class Services extends Component {
    render() {
        return (
            <div id="main">
				<div id="content">
					<section>
						<div className="container">
							<ul>
								<li>AC</li>
								<li>Heating</li>
							</ul>
						</div>
					</section>
				</div>
			</div>
        );
    }
}

export default Services;
